import React, { Component } from "react";
import InCard from "../InCard";
import OutCard from "../OutCard";
import "./style.css";


class CardContainer extends Component {
    render() {
        return (
            <div class="container">
                <div class="row">
                    <div class="col s6">
                    <InCard />   
                    </div>
                    <div class="col s6">
                    <OutCard />    
                    </div>
                </div>    
            </div>
        );
    }
}

export default CardContainer;
